window.bookSummaryJSON = "<p>Titus Crow and his faithful companion and record-keeper fight the gathering forces of darkness - the infamous and deadly Elder Gods of the works of H.P. Lovecraft. Cthulhu and his dark minions are bent on ruling the earth. A few puny humans cannot possibly stand against these otherworldly evil gods, yet time after time, Titus Crow drives the monsters back into the dark from whence they came. <i>Spawn of the Winds </i>is the fourth book in the Titus Crow series.</p>"; 
